import {
  Button,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
} from "@mui/material";
import { useSelector } from "react-redux";
import styled from "styled-components";
import { EditTask } from "../editTask/EditTask";
import { RootState } from "../../../../redux/reducer/store";
import { DeleteTask } from "../deleteTask/DeleteTask";
import ArchiveTask from "../archiveTask/ArchiveTask";
import DeleteArchiveTask from "../deleteArchiveTask/DeleteArchiveTask";

const Title = styled.div`
  h5 {
    font-size: 14px;
    font-weight: 700;
  }
  p {
    border-bottom: 1px solid #eee;
  }
`;
const StyledButton = styled.div`
  display: flex;
  align-items: center;
  padding-left: 200px;
`;
const style = {
  display: "flex",
  alignItems: "center",
  border: "0px",
};

const style2 = {
  width: "953px",
  display: "flex",
  justifyContent: "space-between",
  border: "1px solid #eee",
};

export const CommonTask = (any) => {

  return (
    <div>
      <Title>
        <h5>
          Common Task ({9})<div> </div>
        </h5>
        <p>These tasks are automatically added to all new projects</p>
        <h4>Name</h4>
      </Title>

      <TableContainer component={Paper}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow>
              <TableCell>Name</TableCell>
            </TableRow>
          </TableHead>

          {/* {listSearch.map((item) => { */}
            return (
              <TableBody>
                <TableRow style={style2}>
                  <TableCell style={style}>
                    <EditTask />
                    {/* {item.name} */}
                  </TableCell>
                  <TableCell style={style}>
                    <StyledButton>
                      {/* {!item.isDeleted ? ( */}
                        <ArchiveTask  />
                      ) : (
                        <DeleteArchiveTask  />
                      )

                      {/* {!item.isDeleted ? ( */}
                        <Button
                          variant="outlined"
                          disabled
                          style={{ margin: "0 10px" }}
                        >
                          Delete
                        </Button>
                      
                        <DeleteTask  />
                  
                    </StyledButton>
                  </TableCell>
                </TableRow>
              </TableBody>
          
        </Table>
      </TableContainer>
    </div>
  );
};
